Relationship.create([subject_id: (Resource.find_by literal: 'T0009542').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "基于马克思劳动价值论的观点。只包括经济的\"生产部门\"创造的商品和服务价值，不包括经济的\"非物质生产部门\"创造的大部分服务价值。", language_id: (Language.find_by name: 'zh').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0009542').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "A concept based on Marxian labour theory of value. It is the value of goods and services turned out by the so-called \"productive sectors\" of the economy. It does not cover the bulk of services turned out by the so-called \"non-material branches\" of the economy", language_id: (Language.find_by name: 'en').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0009542').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Concept fondé sur la théorie de la valeur du travail. Valeur des biens et services produits par les \"secteurs productifs\" de l'économie. Ne couvre pas l'ensemble des services produits par les secteurs de production de biens non-matériels de l'économie", language_id: (Language.find_by name: 'fr').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0009542').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Понятие, основывающееся на Марксовой трудовой теории стоимости. Складывается из стоимости товаров и услуг, происходящих из так называемых «производительных секторов» экономики. Не включает основной массы услуг, происходящих из так называемых «нематериальных отраслей» экономики", language_id: (Language.find_by name: 'ru').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0009542').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Concepto basado en la teoría marxista del valor del trabajo. Se trata del valor de los bienes y servicios resultantes de las actividades de los denominados \"sectores productivos\" de la economía. No abarca el grueso de los servicios que prestan los sectores de la economía que producen bienes no materiales", language_id: (Language.find_by name: 'es').id).id])
